  View,
  TouchableOpacity,
  Image,
  ActivityIndicator 
} from 'react-native';

console.disableYellowBox = true;

export default class Base extends React.Component{
  constructor() {
      super();
      this.state = {
        fontLoaded: false
      };
    }
  
   /* async componentDidMount() {
      await Font.loadAsync({
        
        'Poppins-Regular': require('../assets/Fonts/Poppins-Regular.ttf'),
      
      });
  
      this.setState({ fontLoaded: true });
    }*/
      render() {
        return (
          <View > 
            <View style={styles.Cont}>
              <Text style={styles.Cont1}>Mardi 27 Avril{"\n"}2021</Text> 
              <Image source={this.props.back} style={styles.ImageB} />
              <View>
                <Text style={styles.Cont2}>{this.props.title}</Text>
                <Text style={styles.Cont3}>{this.props.unite}</Text>
              </View>
            </View>
          </View>
        );
      }
}
    // create style to component
    const styles = StyleSheet.create({
    
      Cont: {
        //alignItems:'center',
        backgroundColor: 'white',
        height:150.42,
        width:"90%",
        margin:"5%",
        borderRadius: 9.29,
        marginRight:"5%",
        marginLeft:"5%",
        shadowColor: "#000",
        shadowOffset: {
          width: 0,
          height: 16,
        },
        shadowOpacity: 0.58,
        shadowRadius: 16.00,
        elevation: 24,
        flexDirection: 'row',
      },

      Cont1:{
        marginTop:50,
        marginLeft:0,
        marginRight:10,
        fontFamily:"Poppins-Regular",
        fontSize:13.93,
      },

      Cont2:{
        marginTop:25,
        marginLeft:15,
        fontFamily:"Poppins-Regular",
        fontSize:13.93,
      },

      Cont3:{
        marginLeft:65,
        fontFamily:"Poppins-Regular",
        fontSize:28.13 ,
      },
      
      ImageB:{
        marginLeft:34,
        marginTop:20,
        marginRight:39
      },
    })  
